import React from "react";
import {NavLink} from "react-router-dom";
import classNames from "classnames/bind";
import style from "./stylebody.scss";
const Styles = classNames.bind(style);
function Body() {
  return (
    <React.Fragment>
      <div className={Styles("body_main")}>
        <div>
          <NavLink to="">
            <img src="" />
          </NavLink>
        </div>
      </div>
    </React.Fragment>
  );
}

export default Body;
